import { createIcon } from "../icon/createIcon";

export const DownloadIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="DownloadIcon">
    <path d="M9 5 6.015 9 3 5l2.02-.001V0h1.99v4.999L9 5zm-9 6h12v1H0v-1z" />
  </svg>,
  "Download",
  "download"
);
